import * as React from 'react';
import {
  Input, Card, Form, Select, Button,
} from 'antd';
import { useForm } from 'antd/lib/form/util';
import FormItem from 'antd/lib/form/FormItem';
import PhoneCode from 'react-phone-code';
import MainLayout from '../../layout/MainLayout';
import './index.less';

const Login = (): React.ReactElement => {
  const [form] = useForm();
  return (
    <MainLayout sidebarCollapsed>
      <div id="login-page">
        <Card title="Sign in">
          <p>
            Please choose your country and enter your full phone number.
          </p>
          <Form form={form} layout="vertical">
            <FormItem label="Country">
              <PhoneCode
                onSelect={(code: Record<string, any>) => console.log(code)} // required
                showFirst={["US", "IN"]}
                defaultValue='select county'
                id='some-id'
                name='some-name'
                className='some class name'
                optionClassName='some option class name'
              />
              <Select />
            </FormItem>
            <FormItem label="Phone">
              <Input />
            </FormItem>
            <Button>Login</Button>
          </Form>
        </Card>
      </div>
    </MainLayout>
  );
};

export default Login;
